jQuery.fn.topVisuSlider = function(options){
    var settings = {
        txtContainer:'.product_info dd',
        btnContainer:'.slide_page .btn',
        imgContainer:'.product_img .img_area',
        autoplay:true,
        autoDelay:5000
    };
    settings = jQuery.extend(settings, options || {});

    return this.each(function() {
        var self= $(this),
            imgContainer = $(settings.imgContainer , self),
            btnContainer = $(settings.btnContainer , self),
            txtContainer = $(settings.txtContainer , self),
            clickAble= true,
            nowNum=0,
            autoInterval;

        function init() {
            imgContainer.each( function(i) {
                $(this).data('num',i);
            });
            addEvent();
        }
        function addEvent() {
            btnContainer.on('click', function() {
                setVisual($(this).index());
                return false;
            });
            setAutoPlay();
            $(window).resize(onResize);
            onResize();
        }
        function setAutoPlay() {
            if (settings.autoplay) {
                clearInterval(autoInterval);
                autoInterval = setTimeout(nextVisual, parseInt(settings.autoDelay));
            }
        }
        function nextVisual() {

            var num = nowNum+1;
            num = (imgContainer.length <= num) ? 0 : num;
            setVisual(num);
        }
        function setVisual(num) {
            if (clickAble && num != nowNum) {

                setAutoPlay();
                clickAble = false;
                nowNum = num;
                btnContainer.removeClass('on');
                btnContainer.eq(num).addClass('on');

                txtContainer.removeClass('on');
                txtContainer.eq(num).addClass('on');

                imgContainer.removeClass('on');
                imgContainer.each(function() {
                    var _img = $('img',$(this));
                    if ($(this).data('num')== num ) {
                        $(this).addClass('on')
                        imgContainer.parent().append($(this));
                        TweenMax.fromTo(_img, 0.7, {opacity:0}, {opacity:1, ease:Linear.ease});
                        TweenMax.fromTo(_img, 0.7, {'display':'block','margin-left':(parseInt($(this).data('margin'))-80) },{'margin-left':$(this).data('margin'),ease:Power1.easeInOut,  onComplete:function() {
                            clickAble = true;
                        }});
                    }
                    else {

                        _img.css('display','block');
                        TweenMax.to(_img, 0.7,  {opacity:0,  ease:Linear.ease});
                        TweenMax.to(_img, 0.7, {'margin-left':(parseInt($(this).data('margin'))+50),ease:Power1.easeInOut, onComplete: function() {
                            _img.css('display','none');
                        }});
                    }
                });
                txtContainer.each(function() {
                    if ($(this).hasClass('on')) {
                        TweenMax.fromTo($('strong',$(this)), 0.5, {'margin-top':'10px', opacity:0}, {'margin-top':0, opacity:1, ease:Cubic.easeOut});
                        TweenMax.fromTo($('p',$(this)), 0.5, {'margin-top':'10px', opacity:0}, {'margin-top':0, opacity:1, ease:Cubic.easeOut ,delay:0.2});
                    }
                });
            }
        }
        function onResize() {
            imgContainer.each( function() {
                var _margin = (window.innerWidth<768) ? $('img',$(this)).width()/-2 : 0;
                $(this).data('margin',_margin);
                if ($(this).hasClass('on')) {
                    $('img',$(this)).css('margin-left',_margin);
                }
            });
        }

        init();
    });
}
$('.product_slider').topVisuSlider();

