function imgHeight() {
    $(window).on("resize load",function() {
        if($(window).innerWidth() > 767 && $(window).innerWidth() < 1024) {
            setTimeout(function() {
                $('.bcBoxDescRow').each(function() {
                    if ($(this).hasClass("resizeBoxH") && $(window).innerWidth() < 1024)
                    {
                        return false;
                    }
                    $(this).find('.dot').css('height', 'auto');
                    $t = $(this).find('.dot');
                    var maxheight = 0;
                    $(this).find('.dot').each(function() {
                        if(maxheight < $(this).height() ) {
                            maxheight = parseInt($(this).height());
                        }
                    });
                    $t.height(maxheight);
                });
            } , 50);
        } else {
            $('.bcBoxDescRow').find('.dot').css('height','auto');
        }
        if($(window).innerWidth() >= 1024) {
            setTimeout(function() {
                $('.img-align').each(function() {
                    $(this).find('figcaption, .bcImg').css('height', 'auto');
                    var maxheight = 0;
                    $(this).find('figcaption, .bcImg').each(function() {
                        if(maxheight < $(this).height() ) {
                            maxheight = parseInt($(this).height());
                        }
                    });
                    $(this).find('figcaption, .bcImg').height(maxheight);
                });

            } , 50);
        } else {
            $('.img-align').find('figcaption, .bcImg').css('height','auto');
        }
    });
}




$.fn.fullVideoBtn = function(){
    return this.each(function(){
        var $this = $(this),
            $btn  = $(".videoBTN",$this),
            ww = $(window).innerWidth(),
            ww2 = $(window).width(),
            $videoArea =  $(".videoArea",$this),
            imgW = $("img",$btn).width(),
            imgH = $("img",$btn).height(),
            ratio = 1600/900;

        $btn.on("click",function(e){
            e.preventDefault();
            var youtubeSrc = $(this).data("src-video").replace("https://youtu.be/",'');
            var mobileSrc = $(this).data("src-video");
            var frameHtml = '<iframe class="player" src="https://www.youtube.com/embed/'+ youtubeSrc +'?rel=0&autoplay=1" frameborder="0" allowfullscreen></iframe>';
            if (ww >= 768)
            {
                $(this).closest(".videoBox").addClass("on");
                $videoArea.html(frameHtml);
                videoSize();
            }else{
                window.open(mobileSrc);
            }
        });
        function videoSize() {
            var ww = $(window).innerWidth(),
                ww2 = $(window).width();
            if (ww >= 1600)
            {
                $videoArea.find("iframe").width(1448).height(815);
            }else{
                $videoArea.find("iframe").width(ww2).height(ww2 / ratio);
            }
        }
        $(window).resize(videoSize);

    });
}
$(".videoBox").fullVideoBtn();
$(window).on("load",function(){
    if ($(".videoBox").length>0)
    {
        $(".videoBox").fullVideoBtn();
    }
});
